function getLastOpenTransaction(wallet) {
  for (let t in Object.keys(wallet.transactions)) {
    console.log(t);
    if (!wallet.transactions[t].isValid) {
      return t;
    }
  }
}

export default function getReferenceTransactions(wallet, openTransaction) {
  const reference = [];
  const lot = getLastOpenTransaction(wallet);
  if (lot) {
    console.log(lot);
    reference.push(lot.sig);
  }
  if (openTransaction) {
    reference.push(openTransaction.sig);
  }
  return reference;
}
